package main

import (
    "bufio"
    "bytes"
    "encoding/base64"
    "fmt"
    "os"
    "os/exec"
    "strconv"
    "strings"
)

// Base64-encoded contents of testcasesA.txt.
const testcasesA64 = ""

type testCase struct {
    n, t int
    a, b []int
}

// Embedded solution logic from 1822A.go.
func solve(tc testCase) string {
    bestIdx := -1
    bestVal := -1
    for i := 0; i < tc.n; i++ {
        if tc.a[i]+i <= tc.t && tc.b[i] > bestVal {
            bestVal = tc.b[i]
            bestIdx = i + 1
        }
    }
    return strconv.Itoa(bestIdx)
}

func parseTestcases() ([]testCase, error) {
    raw, err := base64.StdEncoding.DecodeString(testcasesA64)
    if err != nil {
        return nil, err
    }
    sc := bufio.NewScanner(bytes.NewReader(raw))
    sc.Split(bufio.ScanWords)
    if !sc.Scan() {
        return nil, fmt.Errorf("invalid test data")
    }
    total, err := strconv.Atoi(sc.Text())
    if err != nil {
        return nil, fmt.Errorf("parse total: %v", err)
    }
    cases := make([]testCase, 0, total)
    for i := 0; i < total; i++ {
        if !sc.Scan() {
            return nil, fmt.Errorf("case %d missing n", i+1)
        }
        n, err := strconv.Atoi(sc.Text())
        if err != nil {
            return nil, fmt.Errorf("case %d parse n: %v", i+1, err)
        }
        if !sc.Scan() {
            return nil, fmt.Errorf("case %d missing t", i+1)
        }
        tVal, err := strconv.Atoi(sc.Text())
        if err != nil {
            return nil, fmt.Errorf("case %d parse t: %v", i+1, err)
        }
        a := make([]int, n)
        for j := 0; j < n; j++ {
            if !sc.Scan() {
                return nil, fmt.Errorf("case %d truncated a", i+1)
            }
            v, err := strconv.Atoi(sc.Text())
            if err != nil {
                return nil, fmt.Errorf("case %d a[%d]: %v", i+1, j, err)
            }
            a[j] = v
        }
        b := make([]int, n)
        for j := 0; j < n; j++ {
            if !sc.Scan() {
                return nil, fmt.Errorf("case %d truncated b", i+1)
            }
            v, err := strconv.Atoi(sc.Text())
            if err != nil {
                return nil, fmt.Errorf("case %d b[%d]: %v", i+1, j, err)
            }
            b[j] = v
        }
        cases = append(cases, testCase{n: n, t: tVal, a: a, b: b})
    }
    return cases, nil
}

func buildIfGo(path string) (string, func(), error) {
    if strings.HasSuffix(path, ".go") {
        tmp, err := os.CreateTemp("", "bin*")
        if err != nil {
            return "", nil, err
        }
        tmp.Close()
        if out, err := exec.Command("go", "build", "-o", tmp.Name(), path).CombinedOutput(); err != nil {
            os.Remove(tmp.Name())
            return "", nil, fmt.Errorf("build failed: %v\n%s", err, out)
        }
        return tmp.Name(), func() { os.Remove(tmp.Name()) }, nil
    }
    return path, func() {}, nil
}

func runCandidate(bin, input string) (string, error) {
    cmd := exec.Command(bin)
    cmd.Stdin = strings.NewReader(input)
    var out bytes.Buffer
    var errBuf bytes.Buffer
    cmd.Stdout = &out
    cmd.Stderr = &errBuf
    if err := cmd.Run(); err != nil {
        return "", fmt.Errorf("runtime error: %v\n%s", err, errBuf.String())
    }
    return strings.TrimSpace(out.String()), nil
}

func main() {
    if len(os.Args) != 2 {
        fmt.Println("usage: go run verifierA.go /path/to/binary")
        os.Exit(1)
    }

    cases, err := parseTestcases()
    if err != nil {
        fmt.Fprintln(os.Stderr, err)
        os.Exit(1)
    }

    bin, cleanup, err := buildIfGo(os.Args[1])
    if err != nil {
        fmt.Fprintln(os.Stderr, err)
        os.Exit(1)
    }
    defer cleanup()

    for idx, tc := range cases {
        var input strings.Builder
        input.WriteString("1\n")
        fmt.Fprintf(&input, "%d %d\n", tc.n, tc.t)
        for i, v := range tc.a {
            if i > 0 {
                input.WriteByte(' ')
            }
            input.WriteString(strconv.Itoa(v))
        }
        input.WriteByte('\n')
        for i, v := range tc.b {
            if i > 0 {
                input.WriteByte(' ')
            }
            input.WriteString(strconv.Itoa(v))
        }
        input.WriteByte('\n')

        want := solve(tc)
        got, err := runCandidate(bin, input.String())
        if err != nil {
            fmt.Fprintf(os.Stderr, "case %d failed: %v\n", idx+1, err)
            os.Exit(1)
        }
        if got != want {
            fmt.Printf("test %d failed\ninput:\n%sexpected: %s\ngot: %s\n", idx+1, input.String(), want, got)
            os.Exit(1)
        }
    }
    fmt.Printf("All %d tests passed\n", len(cases))
}

